410g<br><b>内蔵HDD</b>：2TB<br><b>無線LAN</b>：IEEE802.11n/g/b<br><b>有線LAN</b>：100BASE-TX/10BASE-T<br><b>インターフェース</b><br>　HDMI：○<br>　USB：○<br>　LAN：○<br><b>カードスロット</b><br>　SDカード：○(SDXC/SDHC/SDカード対応)<br>　CFカード：x<br><b>再生可能フォーマット</b><br>　静止画：JPEG<br>　動画：motionJPEG、mp4、H.264/AVC<br><b>NFC</b>：x<br><b>消費電力</b>：最大24W<br><b>付属品</b>：リモコン、乾電池(単4x2)、HDMIケーブル(1.2m)、ACアダプター<style type="text/css">
